import { useState } from "react";
import AddUser from "../AddUser/AddUser";
import UserList from "../UserList/UserList";

const Card = () => {
  
  const [userInput, setUserInput]= useState("");const Arr= Array.from(userInput)
  const DataHandler=(event)=>{
    setUserInput(event);
  }
  return (
    <div>
      <AddUser onSendData={DataHandler}/>
      {!userInput &&  <h1 style={{textAlign:"center"}}> There is no Data</h1>}
      {userInput &&  <UserList userInputs={Arr}></UserList>}
    </div>
  );
};
export default Card;
